<h1> <a href="http://xn--14-Java---yg9nn74ako9avc4a.md" target="_blank" rel="noopener noreferrer">14-Java--单例模式.md</a></h1>
<ul>
<li>
<p>单例模式（singleton）：保证一个类仅有一个实例，并提供一个访问它的全局访问点</p>
