<h1> Java初级测试题四- 数组(9-9)</h1>
<ol>
<li>编写一个简单程序，要求数组长度为5，分别赋值10，20，30，40，50，在控制台输出该数组的值。（知识点：数组定义和创建、一维数组初始化）</li>
